import Vue from 'vue'
import Router from 'vue-router'

Vue.use(Router)

import Layout from "@/pages/layout"

const router = new Router({
    routes: [
        {
            path: '/home',
            name: 'HomePage',
            component: () => import('@/pages/homePage')
        },
        {
            path: '/',
            name: 'Layout',
            components: Layout,
            children: [{
                path: 'Main',
                name: 'workBench',
                component: () => import('@/pages/workBenchPage')
            }]
        }
    ]
})

export default router
